    fetch('https://f3bzwuya7a444klvzuesn2ihje0ipkjr.lambda-url.ap-east-1.on.aws/')
        .then(response => response.json())
        .then(data => setProductList(data))
        console.log(productList)
    },[])

  return (
    <div>

    <div>ProductList</div>
    {
        productList.map(product=>( 
          <div key={product.id}>
          {product.name}
          </div>
        ))
    }

    </div>
  )
}
